  17,\n\t\"tags\": [],\n\t\"title\": \"Temperature, salinity and other variables collected
  from underway - surface observations using PAR Sensor and other instruments from
  the AURORA AUSTRALIS, NOAA Ship DISCOVERER and others in the Bering Sea, Caribbean
  Sea and others from 1994-01-28 to 2004-07-02 (NODC Accession 0109923)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-10-04T05:26:12.818300\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-underway-surface-observations-using-pa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109923 includes biological,
  chemical, meteorological, physical and underway - surface data collected from AURORA
  AUSTRALIS, NOAA Ship DISCOVERER, NATHANIEL B. PALMER, POLARSTERN, NOAA Ship RONALD
  H. BROWN and WECOMA in the Bering Sea, Caribbean Sea, Cordell Bank National Marine
  Sanctuary, Gulf of Alaska, Gulf of Mexico, Gulf of the Farallones National Marine
  Sanctuary, Indian Ocean, Monterey Bay National Marine Sanctuary, North Atlantic
  Ocean, North Pacific Ocean, South Atlantic Ocean and South Pacific Ocean from 1994-01-28
  to 2004-07-02 and retrieved during cruise BACPAC, BLAST I, BLAST II, BLAST III,
  CLIVAR01, GasEx 98 and PHASE1. These data include AIR TEMPERATURE, Benzene (C6H6),
  Bromoform (CHBr3), Bromomethane, also called methyl bromide (CH3Br), CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
  tetrachloride (CCL4), Chlorodifluoromethane or difluoromonochloromethane (HCFC-22),
  Chloroform (CHCl3), Chloromethane, also called methyl chloride (CH3CL), Dibromochloromethane
  (CHBr2Cl), Dibromomethane, also called methylene bromide, or methylene dibromide
  (CH2BR2), FLUORESCENCE, INCOMING SOLAR RADIATION, Methyl iodide, also called iodomethane
  (CH3I), PHOTOSYNTHETIC ACTIVE RADIATION (PAR), PRECIPITATION, RELATIVE HUMIDITY,
  SALINITY, SEDIMENT PROPERTIES, Tetrachloroethylene, or tetrachloroethene, or perchloroethylene
  (PCE), WATER TEMPERATURE, WIND DIRECTION, WIND SPEED and methyl chloroform (MC).
  The instruments used to collect these data include PAR Sensor. These data were collected
  by James W. Elkins and James H. Butler of US DOC; NOAA; OAR; Earth System Research
  Laboratory; Climate Monitoring and Diagnostics Laboratory as part of the NOAA/CMDL
  values of trace halocarbon. data set.nnThe International CLIVAR Global Ocean Carbon
  and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
